import React from 'react';
import './ToTopButton.css';

const ToTopButton = () => {
    return(
            <div className = 'fixed button mr5'>
              <button className="pointer f6 grow no-underline br-pill ph3 pv2 mb2 white bg-near-black">
                To Top
              </button>
            </div>
 );
}

export default ToTopButton;
